import React, { useState } from 'react';
import '/app.css'

const Question = () => {
  const [hint,setTitle] = useState("e.g. What's your favourite color?");

  return (
    <div className= "question">
      <h1>Ask me anything here!</h1>
      <form>
        <textarea type = "text"
          required
          value={hint}
          onChange={(e)=>setTitle(e.target.value)}
        />
      </form>
      <button>Save</button>
    </div> 
  );
};

export default Question;
